// src/App.js
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { CSSTransition, TransitionGroup } from "react-transition-group";
import ZipCodePage from "./UserFlow1/components/ZipCodePage";
import StepOne from "./UserFlow1/components/StepOne";
import StepTwo from "./UserFlow1/components/StepTwo";
import StepThree from "./UserFlow1/components/StepThree";
import StepFour from "./UserFlow1/components/StepFour";
import StepFive from "./UserFlow1/components/StepFive";
import StepSix from "./UserFlow1/components/StepSix";
import Summary from "./UserFlow1/components/Summary";
import StepEmail from "./UserFlow1/components/StepEmail";
import OffersPage from "./UserFlow1/components/OffersPage";
import LoadingDeals from "./UserFlow1/components/LoadingDeals";
import "./App.css";
import "./Form.css";

function App() {
  return (
    <Router>
      <TransitionGroup>
        <CSSTransition
          key={location.key}
          timeout={{ enter: 4000, exit: 4000 }}
          classNames="page"
        >
          <Routes>
            <Route path="/" element={<ZipCodePage />} />
            <Route path="step-one" element={<StepOne />} />
            <Route path="/step-two" element={<StepTwo />} />
            <Route path="/step-three" element={<StepThree />} />
            <Route path="/step-four" element={<StepFour />} />
            <Route path="/step-five" element={<StepFive />} />
            <Route path="/step-six" element={<StepSix />} />
            <Route path="/summary" element={<Summary />} />
            <Route path="/email" element={<StepEmail />} />
            <Route path="/loading-deals" element={<LoadingDeals />} />
            <Route path="/offers" element={<OffersPage />} />
          </Routes>
        </CSSTransition>
      </TransitionGroup>
    </Router>
  );
}

export default App;
